import React from 'react';

import './custom-buttom.styles.scss';

const CustomButton = ({ children,isGoogle, ...otherProps }) => (
  <button className= {`custom-button ${isGoogle ? 'google': ''}`} {...otherProps}>
    {children}
  </button>
);

export default CustomButton;
